  \"Species composition and seasonal numbers of shorebirds at Pea Island, Mattamuskeet,
  Back Bay, Cape Romain, and Merritt Island National Wildlife Refuges\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:24.832481\",\n\t\"name\": \"species-composition-and-seasonal-numbers-of-shorebirds-at-pea-island-mattamuskeet-back-bay\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Wildlife inventory data were used to determined
  species composition and seasonal shorebird numbers at Back Bay, Pea Island, Mattamuskeet,
  Cape Romain and Merritt Island National Wildlife Refuges. Species richness varied
  from 21 to 26. Differences in species composition probably stemmed from differences
  in the array of habitats censused per Refuge. Pea Island harbored the highest numbers
  of shorebirds when treated as an assemblage and for most species. This was likely
  influenced by the Refuge's geographiclocation, embedded within North Carolina's
  Outer Banks, an area of regional importance for shorebirds. Merritt Island harbored
  the highest number of Dunlins. The Refuge is ranked as the most important overwintering
  site for the species in Florida. The numerical importance of other Refuges is not
  as well understood. Timing of migration within and among refuges underscored the
  need for coordinated and integrated management.\",\n\t\"license_title\": \"License
